package bhanuproj;

public class Relational_practice {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
         int x=200;
         int y=500;
         int z=300;
         System.out.println(x<y);
         System.out.println(x>y);
         System.out.println(x<z);
         System.out.println(x>z);
         System.out.println(x==y);
         System.out.println(x!=z);
	}

}
